import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { UserService } from '../services/user.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {
  message: string = "";
  username: string = "";
  password: string = "";
  userRole: string = "";

  constructor(private userService: UserService, private router: Router){}

  login(){
    if(this.username == "" || this.password == "" || this.userRole == ""){
      this.message = "Niste uneli sve informacije!"
    } else {
      this.userService.login(this.username, this.password, this.userRole).subscribe((rez: any)=>{
        if(rez.userType == "gost"){
          this.message = "";
          localStorage.setItem('ulogovan', JSON.stringify(rez.user));
          this.router.navigate(['gost']);
        } else if(rez.userType == "konobar"){
          this.message = "";
          localStorage.setItem('ulogovan', JSON.stringify(rez.user));
          this.router.navigate(['konobar']);
        } else {
          this.message = rez.userType;
        }
      })
    }
  }

  registerGost(){
    this.router.navigate(['registerGost']);
  }
}
<div class="login-container">
  <h2 align="center">Login</h2>
  <div class="input-field">
      <label for="username">Username:</label>
      <input type="text" id="username" [(ngModel)]="username">
  </div>
  <div class="input-field">
      <label for="password">Password:</label>
      <input type="password" id="password" [(ngModel)]="password">
  </div>
  <div class="input-field radio-group">
      <label class="radio-label">
          <input type="radio" name="userRole" value="gost" [(ngModel)]="userRole"> Gost
      </label>
      <label class="radio-label">
          <input type="radio" name="userRole" value="konobar" [(ngModel)]="userRole"> Konobar
      </label>
  </div>
  <div class="button-container">
      <button (click)="login()">Login</button>
      <button (click)="registerGost()">Registracija gosta</button>
  </div>
  <div class="error-message">{{message}}</div>
</div>
